window.bookSummaryJSON = "<p>Confidence is the doorway to success in all areas of life. Whether you want to excel in your career, triple your income, create an amazing relationship, or just feel happy and satisfied with who you are, self-confidence is essential. In this inspiring and liberating book, Dr. Aziz slices through each obstacle on the path towards ever-increasing confidence. </p> <p>Through stories, humor, and the world's most powerful tools, you will discover how to: </p> <p></p> <ul> <li>Eliminate self-doubt and negative thinking. </li> <li>Master five ways to overcome fear. </li> <li>Discover how confidence leads to greater wealth and prosperity. </li> <li>Boost your social power so you can confidently talk with anyone. </li> <li>Enjoy more love in all your relationships. </li> <li>Boldly ask for what you want, so you finally get what you really desire out of life. </li> </ul> <p></p>"; 
